import React from "react";
//import ReactDOM from "react-dom";

export default function main(){
    return(
        <div>
           <ol>Steps to create react app</ol>
           <li><strong>Step1:</strong>Install node.js and npm of higher version which are avaiable.</li>
           <li><strong>Step2:</strong>Install visual studio code editor and select the folder where you want to save the files.</li>
           <li><strong>Step3:</strong>Add extensions javascript, live server, babel javascript</li>
           <li><strong>Step4:</strong>Open terminal and type <b>npx create-react-app my-app</b> and hit enter. The installation will take some time to install.</li>
        </div>
    )
}
